import React from 'react';
import { User } from '../types/user';
import DeleteButton from './DeleteButton';
import MapLink from './MapLink';
import '../styles/UserTable.module.css';

interface UserTableProps {
    users: User[];
    onUserClick: (user: User) => void;
    onDeleteUser: (id: number) => void;
}

const UserTable: React.FC<UserTableProps> = ({ users, onUserClick, onDeleteUser }) => {
    return (
        <table className="userTable">
            <thead>
                <tr>
                    <th>Name / Email</th>
                    <th>Address</th>
                    <th>Phone</th>
                    <th>Website</th>
                    <th>Company Name</th>
                    <th>Actions</th>
                </tr>
            </thead>
            <tbody>
                {users.map(user => (
                    <tr key={user.id} onClick={() => onUserClick(user)}>
                        <td>{user.name} / {user.email}</td>
                        <td>{user.address.street}, {user.address.city}</td>
                        <td>{user.phone}</td>
                        <td><a href={`http://${user.website}`} target="_blank" rel="noopener noreferrer">{user.website}</a></td>
                        <td>{user.company.name}</td>
                        <td>
                            <DeleteButton onClick={() => onDeleteUser(user.id)} />
                        </td>
                    </tr>
                ))}
            </tbody>
        </table>
    );
};

export default UserTable;
